import React, { Component } from "react";
import "./App.css";
import CBS from "./chatbox/CBS";
class App extends Component {
  componentDidMount() {}
  render() {
    return (
      <div className="container">
        <div style="border-radius:5px;margin-left:auto;margin-right:auto">
          <p>Today</p>
        </div>
        <CBS />
      </div>
    );
  }
}

export default App;
